import React from "react";
import { motion } from "framer-motion";
// import aboutImg from "./about.png"; // replace with your image path
import { LightningBoltIcon, CodeIcon, UserGroupIcon, StarIcon , BoltIcon  } from '@heroicons/react/outline';

const About = () => {
    const features = [
        {
          name: "Fast Performance",
          description:
            "Experience lightning-fast load times and smooth performance across all devices.",
          icon: BoltIcon,
        },
        {
          name: "Achievements",
          description:
            "We’ve achieved multiple milestones that showcase our excellence and growth.",
          icon: TrophyIcon,
        },
        {
          name: "Trusted Quality",
          description:
            "Our commitment to quality and reliability ensures a trusted experience.",
          icon: StarIcon,
        },
      ];
  return (
    <div className="about-container">
    <h2 className="about-title">About Us</h2>
    <div className="about-features">
      {features.map((feature) => (
        <div key={feature.name} className="feature-card">
          <feature.icon className="feature-icon" />
          <h3 className="feature-title">{feature.name}</h3>
          <p className="feature-description">{feature.description}</p>
        </div>
      ))}
    </div>
  </div>
  );
};

export default About;
